INSERT INTO `email_templates` (`EMAIL_TEMPLATE_ID`, `EMAIL_TEMPLATE_NAME`, `PRE_CONDITION`, `EMAIL_SUBJECT`, `EMAIL_CONTENT`, `STATUS`) VALUES
(1, 'Registration', 'Registration', 'Your Confirm Password For Registration in to our website', '<!doctype html>\n<html>\n<link href=\"https://fonts.googleapis.com/css?family=Courgette|Roboto:300,400,500\" rel=\"stylesheet\">\n<body  style=\"margin: 0 auto;background: rgba(233,233,233,1.00);\">\n	<div id=\"templateBody\" style=\"border: 3px solid #e2e2e2;\n    width: 50%;\n    margin: 40px auto 40px auto;\n    border-radius: 5px;background-color:white;\">\n		<div id=\"gtheader\" style=\"background: #fff;padding: 15px;\">\n			<div id=\"gtLogo\" style=\"\">\n				<img src=\"site domain name/img/logo\" style=\"max-height: 70px;\">\n			</div>	\n		</div>\n		<div id=\"gtstrip\" style=\"background: #ea2626;padding: 10px;text-align:center;\">\n				<h5 style=\"font-size: 40px;font-weight: 200; font-family: Roboto, sans-serif;margin-top: 0px;margin-bottom: 0px;color: #fff;padding: 10px 15px 10px 15px;\">Email Verification</h5>\n		</div>\n		<div id=\"gtBody\" style=\"margin-top: 0px;margin-bottom: 5px;padding: 15px;\">\n			<div id=\"verifyContent\">\n				<p style=\"margin-top:10px;margin-bottom: 10px;font-family: Roboto, sans-serif;font-weight: 400;font-size: 15px;\">You are registerd with your site name,Please verify your email id.</p>\n			</div>\n			<div id=\"gtUDetails\" style=\"display: table;width: 100%;margin-bottom: 30px;\">\n				\n				<div style=\"display:table-cell;margin-top: 0px;vertical-align: top;width:70%;\">\n					<h5 style=\"margin-top:10px;margin-bottom: 10px;font-family: Roboto, sans-serif;font-weight: 400;font-size: 14px;\">Matri Id:matriid\n					</h5>\n					<h5 style=\"margin-top:10px;margin-bottom: 10px;font-family: Roboto, sans-serif;font-weight: 400;font-size: 14px;\">Name:name</h5>\n					\n				</div>\n			</div>\n			<div id=\"gtlogin\" style=\"text-align: center;\">\n				<a href=\"site domain name?confirm_id=cpass&amp;email=email_id\" style=\"font-family: Roboto, sans-serif;\n				padding: 10px 30px 10px 30px;\n    font-size: 18px;\n    background: rgb(234, 38, 38);\n    display: inline-block;\n    color: white;\n    text-decoration: none;\n    border-radius: 3px;\n    margin-top: 15px;\n    margin-bottom: 15px;\">Verify Email</a>\n			</div>\n			<div id=\"gtIncase\" style=\"text-align: center;\">\n			<h4 style=\"font-family: Roboto, sans-serif;font-weight: 300;\n				\">Incase you can not verify email id by clicking on button please copy and paste this link in url.<a href=\"site domain name?confirm_id=cpass&amp;email=email_id\" style=\"font-family: Roboto, sans-serif;\n				\"><br> site domain name?confirm_id=cpass&amp;email=email_id</a></h4>\n				\n			</div>\n			<div id=\"gtThank\">\n				<p style=\"font-family: Roboto, sans-serif;\n    font-weight: 500;\n    font-size: 14px;\n    color: #565656;\n    margin-top: 30px;\n    margin-bottom: 5px;\">Thank You</p>\n				<h5 style=\"font-family: Roboto, sans-serif;\n    font-size: 18px;\n    color: #ea2626;\n    margin-top: 5px;\n    font-weight: 500;\">Team your site name</h5>\n			</div>\n		</div>\n		<div id=\"gtFooter\" style=\"padding: 15px;text-align: center;background: #efefef;\n    \">\n			<h5 style=\"font-family: Roboto, sans-serif;margin-top: 10px;\n    margin-bottom: 5px;\n    font-size: 18px;\n    font-weight: 300;\">Join us on</h5>\n    <div>\n    	<a href=\"fb1\" style=\"margin-left: 2px;\n    margin-right: 2px;\" target=\"_blank\"><img src=\"site domain name/img/if_square-facebook_317727.png\" style=\"width:38px;\"></a>\n    	<a href=\"tw1\" style=\"font-size: 44px;\n    color: #707171;\n    margin-left: 2px;\n    margin-right: 2px;\" target=\"_blank\"><img src=\"site domain name/img/if_square-twitter_317723.png\" style=\"width:38px;\"></a>\n    	<a href=\"li1\" style=\"font-size: 44px;\n    color: #707171;\n    margin-left: 2px;\n    margin-right: 2px;\" target=\"_blank\"><img src=\"site domain name/img/if_square-linkedin_317725.png\" style=\"width:38px;\"></a>\n    	<a href=\"gp1\" style=\"font-size: 44px;\n    color: #707171;\n    margin-left: 2px;\n    margin-right: 2px;\" target=\"_blank\"><img src=\"site domain name/img/if_square-google-plus_317726.png\" style=\"width:38px;\"></a>\n    	</div>\n		</div>\n	</div>\n</body>\n</html>\n\n				', 'APPROVED'),
(2, 'Delete Member', 'MEMBER_ACTION', 'Your request for deleting profile is being processed', '<!doctype html>\n<html>\n<link href=\"https://fonts.googleapis.com/css?family=Courgette|Roboto:300,400,500\" rel=\"stylesheet\">\n<body  style=\"margin: 0 auto;background: rgba(233,233,233,1.00);\">\n	<div id=\"templateBody\" style=\"border: 3px solid #e2e2e2;\n    width: 50%;\n    margin: 40px auto 40px auto;\n    border-radius: 5px;background-color:white;\">\n		<div id=\"gtheader\" style=\"background: #fff;padding: 15px;\">\n			<div id=\"gtLogo\" style=\"\">\n				<img src=\"website/img/logo\" style=\"max-height: 70px;\">\n			</div>	\n		</div>\n		<div id=\"gtstrip\" style=\"background: #ea2626;padding: 10px;text-align:center;\">\n				<h5 style=\"font-size: 40px;font-weight: 200; font-family: Roboto, sans-serif;margin-top: 0px;margin-bottom: 0px;color: #fff;padding: 10px 15px 10px 15px;\">Profile Deleted</h5>\n		</div>\n		<div id=\"gtBody\" style=\"margin-top: 0px;margin-bottom: 5px;padding: 15px;\">\n			<div id=\"verifyContent\">\n				<p style=\"margin-top:10px;margin-bottom: 10px;font-family: Roboto, sans-serif;font-weight: 400;font-size: 18px;\">Your Profile has been deleted as per your request.Incase of any query contact on contact_no.</p>\n			</div>\n			\n			\n			\n			<div id=\"gtThank\">\n				<p style=\"font-family: Roboto, sans-serif;\n    font-weight: 500;\n    font-size: 14px;\n    color: #565656;\n    margin-top: 30px;\n    margin-bottom: 5px;\">Thank You</p>\n				<h5 style=\"font-family: Roboto, sans-serif;\n    font-size: 18px;\n    color: #ea2626;\n    margin-top: 5px;\n    font-weight: 500;\">Team webfriendlyname</h5>\n			</div>\n		</div>\n		<div id=\"gtFooter\" style=\"padding: 15px;text-align: center;background: #efefef;\n    \">\n			<h5 style=\"font-family: Roboto, sans-serif;margin-top: 10px;\n    margin-bottom: 5px;\n    font-size: 18px;\n    font-weight: 300;\">Join us on</h5>\n    <div>\n    	<a href=\"facebookurl\" style=\"margin-left: 2px;\n    margi